import React from 'react';
import style from './stylesheet';
const HeaderMenu = ({
    width,
    image
}) => {
    return <div className="headerMenu">
        <img
            href={image}
            width={width}
            height="auto"
        />
        <style jsx>{style}</style>
    </div>
};
export default HeaderMenu;
